import React from "react";
import { Panel, Table } from "rsuite";
import { connect } from "react-redux";

const Home = ({projects}) => {
  const imgStyles = {
    height: "20rem",
    width: "100%",
  };
  const { Column, HeaderCell, Cell } = Table;
  return (
    <div
      style={{
        padding: "1.3rem",
        display: "flex",
        justifyContent: "space-between",
      }}
    >
      <div className="leftSide">
        <Panel
          shaded
          bordered
          bodyFill
          style={{
            display: "inline-block",
            width: "100%",
          }}
        >
          <img style={imgStyles} src="https://via.placeholder.com/500" />
          <Panel header="Latest Changes">
            <Table>
              <Column align="center" fixed>
                <HeaderCell>Project</HeaderCell>
                <Cell dataKey="project_name" />
              </Column>
              <Column align="center" fixed>
                <HeaderCell>Section</HeaderCell>
                <Cell dataKey="code" />
              </Column>
              <Column align="center" fixed>
                <HeaderCell>Snippet</HeaderCell>
                <Cell dataKey="snippet" />
              </Column>
              <Column align="center" fixed>
                <HeaderCell>Date</HeaderCell>
                <Cell dataKey="date" />
              </Column>
            </Table>
          </Panel>
        </Panel>
      </div>
      <div className="rightSide">
        <Panel
          shaded
          bordered
          bodyFill
          style={{
            width: "100%",
            padding: "1rem",
          }}
        >
          <div
            style={{
              display: "flex",
              flexFlow: "row wrap",
              justifyContent: "space-around",
            }}
          >
          {projects.map((project)=>(
            <Panel
              header={project.project_title}
              style={{
                marginBottom: "1rem",
                width: "48%"
              }}
              collapsible
              bordered
              >
                <p>Place hodler data, to be filled on backend update.</p>
            </Panel>
          ))}
            <Panel
              header="Project One"
              style={{
                marginBottom: "1rem",
                width: "48%",
              }}
              collapsible
              bordered
            >
              <p>This is some filler text</p>
            </Panel>

            <Panel
              header="Project Two"
              style={{
                marginBottom: "1rem",
                width: "48%",
              }}
              collapsible
              bordered
            >
              <p>This is some filler text</p>
            </Panel>
            <Panel
              header="Project Two"
              style={{
                marginBottom: "1rem",
                width: "48%",
              }}
              collapsible
              bordered
            >
              <p>This is some filler text</p>
            </Panel>
          </div>
        </Panel>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    projects: state.projects_data.projects
  }
}

export default connect(mapStateToProps,{})(Home);
